import logo from './logo.svg';
import './App.css';
import Header from "./Header/Header";
import News from "./News/News";
import anons from "./img/anonspost.jpg"
function App() {
    const news = [
        { title: '–ó–∞–≥–æ–ª–æ–≤–æ–∫ –Ω–æ–≤–æ—Å—Ç–∏ 1', description: '‚ö° –ó–∞–ª–µ—Ç–∞–µ–º —Å –∞–Ω–æ–Ω—Å–æ–º –Ω–∞—à–µ–≥–æ –Ω–æ–≤–æ–≥–æ —Å–æ—Å—Ç–∞–≤–∞ –ø–æ CS:GO ‚ö°\n' +
                '\n' +
                'üí• –ü–æ–ø—Ä–∏–≤–µ—Ç—Å—Ç–≤—É–π—Ç–µ –Ω–∞—à–∏—Ö —Ä–µ–±—è—Ç –∏ –¥–∞–≤–∞–π—Ç–µ –ø–æ–∂–µ–ª–∞–µ–º –∏–º –∑–∞–≤–æ–µ–≤–∞—Ç—å –∫–∞–∫ –º–æ–∂–Ω–æ –±–æ–ª—å—à–µ —Ç–∏—Ç—É–ª–æ–≤ –≤–º–µ—Å—Ç–µ üí•\n' +
                '\n' +
                ' –ü–∞–≤–µ–ª waterzy –ë–∞—Ä–∞—à–∫–æ–≤\n' +
                ' –≠–¥–≤–∞—Ä–¥ Kaide –¢–∞—Ç–∞—Ä–∏–Ω–æ–≤\n' +
                ' –†—É—Å–ª–∞–Ω Magickst –ì–∞—Ñ–∏–µ–≤\n' +
                ' –ò–ª—å—è 1ll –í–æ—Ä–æ–Ω–æ–≤\n' +
                ' –†–µ–Ω–∞—Ç SUROVIY666 –ê–±–¥—Ä–∞—Ö–º–∞–Ω–æ–≤' , image: "https://sun9-14.userapi.com/impg/QjsjsXhfNToNS6WFhhRhHlL_J8Tb2qQFEW82Ew/Sv3e5bhLkZ8.jpg?size=1920x1080&quality=96&sign=fc0d8d753ece11246302ce67a17cebe6&type=album"},

        // –î–æ–±–∞–≤—å—Ç–µ –¥—Ä—É–≥–∏–µ –Ω–æ–≤–æ—Å—Ç–∏ –≤ –º–∞—Å—Å–∏–≤
    ];
  return (
    <div className="App">
        <body>
        <Header />
        <News news={news}/>

        </body>
    </div>
  );
}

export default App;
